Dora Venter, Michelle Wild, Sandy Style, Bianca, Maya, Sandra Iron, Niki Black, Csoky Ice, Nick Lang, Bob Terminator, Claudio Meloni



Tom, a paparazzi, is assigned to get pictures of Sophie, who is vacatoning in Crotia. He won't take his girlfriend Maggie, and she decides to get even. In Croatia, Tom locates Sophie, but Maggie and a friend steal his pictures. Wounded, Tom is looked after by Sophie and her girls. Meanwhile, Maggie gets involved in double penetrations with Sophie's bodyguards, and Tom falls in love with Sophie. Shot on beautiful locations in Croatia and Bosnia.
